import {CroctProvider, Slot,useContent,useCroct} from '@croct/plug-react'
function OnBoardingPage(){
  const croct = useCroct();
  function getDeveloper(){
      croct.user.edit().set('custom.persona', 'developer')
  }
  function getMarketing(){
    croct.user.edit().set('marketer')
  }
  return (
    <div>
      <button onClick={getDeveloper()}>Developer</button>
      <button onClick={getMarketing()}>Marketing</button>
    </div>
  )
}
function App() {
  return (
    <CroctProvider appId="00000000-0000-0000-0000-000000000000"> 
    <div>
    <OnBoardingPage/>
    </div>
    </CroctProvider>
  );
}

export default App;
